// loadFromLayout applies a 2D tile index array directly to the tile map
func (sr *SimpleRoom) loadFromLayout(layout [][]int) {
	// Simply copy the layout to the tilemap - much simpler!
	for y, row := range layout {
		if y >= sr.tileMap.Height {
			break
		}
		for x, tileIndex := range row {
			if x >= sr.tileMap.Width {
				break
			}
			sr.tileMap.SetTile(x, y, tileIndex)
		}
	}
}

// Update handles room-specific logic
func (sr *SimpleRoom) Update(player *entities.Player) error {
	// Add any room-specific update logic here
	// For now, just use the base implementation
	return sr.BaseRoom.Update(player)
}

// HandleCollisions provides collision detection for this room
func (sr *SimpleRoom) HandleCollisions(player *entities.Player) {
	// Get player position
	playerX, playerY := player.GetPosition()
	physicsUnit := engine.GetPhysicsUnit()
	
	// Convert player position to tile coordinates
	charTileX := playerX / physicsUnit
	charTileY := playerY / physicsUnit

	// Check collision with ground tiles
	if charTileY >= 0 && charTileY < sr.tileMap.Height {
		for checkY := charTileY; checkY < sr.tileMap.Height; checkY++ {
			if charTileX >= 0 && charTileX < sr.tileMap.Width {
				tileIndex := sr.tileMap.GetTileIndex(charTileX, checkY)
				if IsSolidTile(tileIndex) {
					// Found solid ground, stop falling
					if playerY > checkY*physicsUnit {
						player.SetPosition(playerX, checkY*physicsUnit)
						vx, _ := player.GetVelocity()
						player.SetVelocity(vx, 0)
					}
					return
				}
			}
		}
	}

	// Fallback to original ground collision
	sr.BaseRoom.HandleCollisions(player)
}

// GetParallaxRenderer returns the parallax renderer for this room
func (sr *SimpleRoom) GetParallaxRenderer() *engine.ParallaxRenderer {
	return sr.parallaxRenderer
}

// FindFloorAtX finds the Y position of the floor at the given X coordinate
// Returns the Y position in physics units where the character should stand
func (sr *SimpleRoom) FindFloorAtX(x int) int {
	physicsUnit := engine.GetPhysicsUnit()
	tileX := x / physicsUnit
	
	// Clamp to valid tile coordinates
	if tileX < 0 {
		tileX = 0
	}
	if tileX >= sr.tileMap.Width {
		tileX = sr.tileMap.Width - 1
	}
	
	// Scan down from the top to find the first solid tile
	for tileY := 0; tileY < sr.tileMap.Height; tileY++ {
		tileIndex := sr.tileMap.GetTileIndex(tileX, tileY)
		if IsSolidTile(tileIndex) {
			// Return the Y position on top of this tile
			return tileY * physicsUnit
		}
	}
	
	// If no solid tile found, use the bottom of the map
	return (sr.tileMap.Height - 1) * physicsUnit
}

// Draw renders the room and its tiles
func (sr *SimpleRoom) Draw(screen *ebiten.Image) {
	// Draw parallax layers without camera offset (for static views)
	if sr.parallaxRenderer != nil {
		sr.parallaxRenderer.DrawParallaxLayers(screen, 0, 0)
	}

	// Draw tiles using sprite provider function
	sr.DrawTiles(screen, sr.getTileSprite)
	
	// Draw debug grid overlay (if enabled)
	engine.DrawGrid(screen)
}

// DrawWithCamera renders the room with camera offset
func (sr *SimpleRoom) DrawWithCamera(screen *ebiten.Image, cameraOffsetX, cameraOffsetY float64) {
	// Draw enhanced multi-layer parallax background/foreground
	if sr.parallaxRenderer != nil {
		sr.parallaxRenderer.DrawParallaxLayers(screen, cameraOffsetX, cameraOffsetY)
	}

	// Draw tiles with camera offset
	sr.DrawTilesWithCamera(screen, sr.getTileSprite, cameraOffsetX, cameraOffsetY)
	
	// Draw debug grid overlay (if enabled) - grid moves with camera
	if engine.GetGridVisible() {
		engine.DrawGridWithCamera(screen, cameraOffsetX, cameraOffsetY)
	}
}
